import React from "react";
import { Route } from "react-router-dom";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css'


function App() {
  return (
    <div className="App">
      <Route path="/" exact>
        <Navbar />
      </Route>
    </div>
  );
}

export default App;
